INSERT INTO `notes` (`id`, `title`, `description`, `create_date`, `pinned`, `username`) VALUES
(1, 'Lorem', 'An elven mage who was a member of the Hero Party. Although she looks young, she was born into a long-lived race of elves and has lived for over a thousand years. Because her sense of time is different from that of humans, she does not mind working for months, if not years, at a time. After the death of Himmel, a member of the party, Frieren regrets not getting to know him better during their ten-year adventure. As a result, she embarks on another journey to learn more about humanity. She also travels with a human wizard apprentice, Fern, after taking her on as an apprentice at Heiter\'s suggestion.\r\nOver a thousand years ago, the great wizard Flamme saved Frieren when demons attacked her hometown. This experience caused Frieren to develop a deep-seated hatred for demons, fueling her ambition to eliminate them. After the Demon King\'s death, Frieren dedicated herself to researching demon-slaying magic[c] while continuing to kill them whenever she could. As the wizard who has buried the most demons in recorded history, she has earned the moniker \"Frieren the Slayer\",[d] and is feared by the demon race. Despite her accomplishments, Frieren has also faced several defeats and struggles. As an elf, she is often perceived as being insensitive to human emotions. Her occasional clumsiness in social interactions leads others to mistakenly label her as aloof, but she is actually kind and caring.', '2024-04-11 16:09:59', 'yes', 'Frieren'),
(2, 'About Fern', 'Frieren\'s apprentice. She is a war orphan from a southern country who lost her parents and was about to commit suicide by jumping off a ravine when Heiter rescued her. As a child, she began training in magic under Heiter\'s tutelage to become more self-sufficient. She later met Frieren, who visited Heiter when she was nine years old, and requested that Frieren teach her magic so she could become a full-fledged mage. After Heiter\'s death, by which she has turned fifteen, she embarks on a journey as Frieren\'s apprentice. Later, she becomes a first-class mage after passing the examination. Though she initially treats Stark coldly, she eventually warms up to him as they bond, but still scolds him when he causes trouble.', '2024-04-11 16:10:18', 'yes', 'Frieren'),
(3, 'About Stark', 'A young warrior who Eisen raised, who serves as a replacement for him on Frieren\'s adventure. Since Eisen declines the invitation due to his old age, Stark steps up to be the frontline fighter in battles, a role that Frieren and Fern, being magicians, are unsuited for. Despite his timid nature, Stark is a strong and capable warrior and loyal to his companions.', '2024-04-11 16:10:33', 'yes', 'Frieren'),
(4, 'About Himmel', 'A human member of the Hero Party. He was the hero of the group and a self-proclaimed handsome man. After seeing a meteor shower together, he and Frieren promise to meet again. He dies shortly after their reunion fifty years later, prompting her to embark on a new journey.', '2024-04-11 16:10:54', 'yes', 'Frieren'),
(5, 'About Heiter', 'A human member of the Hero Party, who was an alcohol-loving priest. He found, adopted, and raised Fern after the party dissolved, and dies near the beginning of the story.', '2024-04-11 16:11:12', 'yes', 'Frieren'),
(6, 'About Eisen', 'A member of the Hero Party. He is a dwarf who, although not as long-lived as elves, has a significantly longer lifespan than humans. However, despite his extended lifespan, he is past his prime and has grown old. As a result, he declines Frieren\'s invitation to embark on a new adventure, choosing to spend his remaining days in peace and recommending that Stark accompany her instead.', '2024-04-11 16:11:49', 'yes', 'Frieren'),
(7, 'About Schlacht', 'Schlacht the Omniscient was a demon who was said to be the Demon King\'s confidant, who had the ability to see into the future, and was said to be capable of seeing forward up to a thousand years. About ten years before the Demon King was defeated, he fought against the Hero of the South, leading all of the Seven Sages of Destruction. However, in this battle, he was defeated alongside three of the Sages of Destruction.', '2024-04-11 16:12:29', 'no', 'Frieren'),
(8, 'About Aura', 'A member of the Seven Sages of Destruction, and an old nemesis of Frieren and the Hero Party, who they managed to defeat many years ago, but she was able to escape. She wields the Scales of Obedience, which allow her to dominate her opponents and turn them into puppets to decapitate them, which has earned her the moniker “The Guillotine”. When she attempts to use the Scales of Obedience on Frieren, she falls under her control instead and decapitates herself by Frieren\'s orders.', '2024-04-11 16:12:41', 'no', 'Frieren'),
(9, 'About Macht', 'Macht, also known as Macht of Golden Land, is a demon and the most powerful of the Demon King\'s Seven Sages of Destruction. An oddity amongst his race, he grew interested in humans and left his post to learn about them, even swearing allegiance to Lord Glück of Weise. However, his aggressive methods of doing so prompted him to transmute the entire city into gold, causing the Continental Magic Association to seal him inside a barrier, where he remained until he crossed paths with Frieren.', '2024-04-11 16:12:59', 'no', 'Frieren'),
(10, 'About Grausam', 'Also known as Grausam the Miraculous, he was one of the Seven Sages of Destruction that served the Demon King. Along with the other Sages and the Omniscient Schlacht, he battled the Hero of the South, but survived. According to Frieren, Grausam was later defeated by the Hero Party during their journey.', '2024-04-11 16:13:16', 'no', 'Frieren'),
(11, 'About Böse', 'The Immortal Böse was one of the Seven Sages of Destruction. Böse, along with the other Sages of Destruction, fought against Hero of the South, though he survived the encounter with him. Eventually, he was defeated by the Hero Party, after Frieren helped Himmel visualize how to break his nigh impenetrable barrier magic.', '2024-04-11 16:13:42', 'no', 'Frieren'),
(12, 'About Qual', 'Also Known as the \"Elder Sage of Corruption\", the Hero Party sealed him away as he was too strong to defeat. Several decades later, Frieren unseals him and destroys him with Fern\'s assistance. Qual is the creator of \"Zoltraak\", a powerful offensive magic which becomes the mages\' standard attack spell after human researchers studied and deciphered it while he was sealed.', '2024-04-11 16:16:37', 'no', 'Frieren'),
(13, 'About Lügner', 'A demon serving under Aura who is tasked with having a town\'s anti-demon barrier put down under the guise of being a “peace envoy.” Fern later kills him when they fight in a duel.', '2024-04-11 16:17:00', 'no', 'Frieren'),
(14, 'About Linie', 'One of Lügner‘s assistants. She is a demon capable of reading her opponent\'s mana to use it against them. Stark later kills her when they fight in a duel.', '2024-04-11 16:17:19', 'no', 'Frieren'),
(15, 'Lorem Ipsum', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', '2024-04-11 17:55:41', 'no', 'Rhai'),
(17, 'Lorem', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', '2024-04-12 00:02:24', 'no', 'Frieren');

